 (123534, 3807842, 'Chang and Eng', 3.28, 'In this stunning novel, <strong>Darin Strauss</strong> combines fiction with astonishing fact to tell the story of history’s most famous twins. Born in Siam in 1811—on a squalid houseboat on the Mekong River—Chang and Eng Bunker were international celebrities before the age of twenty. Touring the world’s stages as a circus act, they settled in the American South just prior to the Civil War. They eventually married two sisters from North Carolina, fathering twenty-one children between them, and lived for more than six decades never more than seven inches apart, attached at the chest by a small band of skin and cartilage. Woven from the fabric of fact, myth, and imagination, Strauss’s narrative gives poignant, articulate voice to these legendary brothers, and humanizes the freakish legend that grew up around them. Sweeping from the Far East and the court of the King of Siam to the shared intimacy of their lives in America, <strong>Chang and Eng</strong> rescues one of the nineteenth century’s most fabled human oddities from the sideshow of history, drawing from their extraordinary lives a novel of exceptional power and beauty.', null, 'Paperback', '0452281091', '9780452281097', 336, '2001-05-01', 2001, 'Plume', 1428, 170), 
 (165531, 3807842, 'The Real McCoy', 3.2, 'From Darin Strauss, the bestselling author of <strong>Chang and Eng</strong> (A <strong>Los Angeles Times</strong> Best Book of the Year), comes the unforgettable story of "Kid" McCoy: boxer, jewel thief, scam artist, and the most married man in America. A fascinating mirror of the tumultuous backdrop of America at the turn of the century, <strong>The Real McCoy</strong> is "a muscular and entertaining novel about lies, scams, flimflams, and the inconvenience of truth" (<strong>GQ</strong>)', null, 'Paperback', '0452284414', '9780452284418', 336, '2003-05-27', 2003, 'Plume', 71, 6), 
 (1103952, 3807842, 'As Smart as We Are', 3.7, null, null, 'Hardcover', '1932360425', '9781932360424', 32, '2004-04-30', 2004, 'Soft Skull Press', 10, 0), 
 (1293860, 3806785, 'The Awakened City', 3.39, 'Following her acclaimed novel "The Burning Land", Victoria Strauss delivers a powerful tale of faith and persecution, forbidden magic, love, and redemption. . . .<br><br>After long years of oppression, the Kingdom of Arsace has reclaimed the capital city of Ninyâser and the First Temple of Ârata. But the powerful Brethren can tolerate no challenge to their rule of the Âratist church, and an expedition to destroy the secret colony of Refuge, home to ancient mysteries and heretical sorcery, has become the catalyst for war.<br><br>Râvar, the last and mightiest of Refuge’s hidden Shapers, vows vengeance against the Brethren and the god he believes has abandoned him. Kidnapping the Dreamer Axane to aid him in his quest, he claims the title of Next Messenger, harbinger of the world’s rebirth into a new age of light, and, with his army of fanatical followers, marches on the holy city of Baushpar. As Arsace races to prepare for battle, the Shaper and former priest Gyalo Amdo Samchen must leave his peaceful life behind to save Axane--and to confront, at last, his own terrifying destiny.<br><br>Against a backdrop of war, insurrection, and sacrifice, two powerful Shapers must discover who is the true Next Messenger, a quest that could transform their world...or utterly destroy it.', null, null, '038097892X', '9780380978922', null, null, null, null, 31, 2), 
 (1293861, 3806785, 'The Lady Of Rhuddesmere', 4.0, 'Geraint, the bastard son of the wealthy and vengeful Baron of Wallestoke, is sent into service in the household of the lady of Rhuddesmere. He finds that Rhuddesmere is a poor and isolated estate surrounded by many mysteries. The lady, beautiful and sad, seems preoccupied with the past and with her vision of God. Urien, her crippled son, is a brilliant scholar, bitterly opposed to the lady’s beliefs. There are topics that cannot be discussed and places that cannot be entered.<br><br>Despite the atmosphere of secrecy, Geraint is content at Rhuddesmere, where he experiences acceptance and affection for the first time. When Urien agrees to teach him to read and write, his happiness seems complete.<br><br>Yet disquieting signs continue, and in a shattering moment Geraint learns the lady’s dreadful secret. But when he flees, stumbling back to Wallestoke, he discovers something worse: he may have unknowingly exposed the lady and her household to a terrible fate.', null, 'Hardcover', '0723262101', '9780723262107', 218, '1982-01-01', 1982, 'Frederick Warne and Company', 5, 0), 
 (1293862, 3806785, 'Guardian of the Hills', 3.62, 'The pyramid-shaped hills were built in a mythic time, and to the Native Americans of Arkansas they are sacred and alive. Now Pamela’s grandfather means to excavate the hills. He dismisses with contempt the legends of the Quapaw Indians, his own wife’s people. Instead, he seeks the glory of discovering an early American culture as rich as the Aztecs’.<br><br>But as men and machinery move into the scorching valley, there are terrible accidents, violent fights and accusations. Crows begin to gather in the hellish heat…thousands of them, ominous and waiting.<br><br>For something is awakening beneath the hills of the Quapaw, an ancient evil eager to be free. And Pamela, barely aware of her own Native American heritage, is caught between her grandfather’s close-minded beliefs and a supernatural being who reaches out to her in dreams. She must face the choice her mother rejected years ago: to embrace the destiny that awaits her in the hills, or deny the truest part of herself forever.', null, null, '0688069983', '9780688069988', null, null, null, null, 8, 0), 
 (2529446, 3806785, 'The Burning Land', 3.8, 'A sweeping tale of magic, oppression, danger, love, temptation, and revelation.<br><br>After long years of oppression, the rightful rulers of Arsace have finally reclaimed the holy city of Baushpar and the First Temple of Ârata. At last, the desecrated shrines can be rebuilt and the people’s suffering redressed. But tensions between the secular and sacred worlds abound, and rumors arise of heretic Shapers–powerful mages who hold no allegiance either to the King or to the leaders of the Âratist church, and whose magics know no restraint.<br><br>Deep in the sacred wastes of the Burning Land, the Dreamer Axane has dared to seek visions of the outside world beyond the hidden enclave of Refuge–a world the people of Refuge no longer believe exists, a world that has no tolerance for change and will soon breach the boundaries of Refuge’s secret sanctuary. But Axane’s Dreaming is forbidden, and to warn her people is to doom herself…<br><br>Chosen to lead an expedition to reclaim the renegade mages, Gyalo Amdo Samchen, priest and Shaper, must cross the Burning Land in a deadly adventure of danger and temptation, a journey that will force him to face his innermost demons and possibilities both sacred and profane. For Refuge hides a shocking truth about the nature of the world itself–a secret that heralds both destruction and transformation, and whose revelation will ignite a holy war.', null, null, '0380978911', '9780380978915', null, null, null, null, 64, 9), 
 (2529447, 3806785, 'Worldstone', 3.13, 'Sixteen-year-old Alexina, estranged from society by her unrealized extrasensory powers, rescues Taryn, a teenager from the parallel world of mindpower, who awakens Alexina’s long-hidden gift. Awed by the discovery of her psychic ability and hoping to belong at last, Alexina eagerly joins Taryn and his companions in their Quest to recover the living Stone, the heart of the mindpower world stolen by a renegade from their universe.<br><br>The search leads them deep into the wilderness, to an enchanted palace surrounded by thorns. There the thief waits, a being of incalculable strength who calls to Alexina with a power she cannot deny, and a promise she does not understand.<br><br>In the battle that follows, good and evil become indistinguishable, and Alexina learns that friendship does not always guard against betrayal.', null, 'Paperback', '0451147561', '9780451147561', 301, '1987-03-03', 1987, 'Signet', 15, 0), 
 (2707148, 3807842, 'More Than it Hurts You', 2.9, 'Josh Goldin was savoring a Friday afternoon break in the coffee room, anticipating the weekend at home where his wife, Dori, waited with their eight-month-old son, Zack. And then Josh''s secretary rushed in, using words like "intensive care, lost consciousness, blood...." <br>That morning, Dori had walked into the emergency room with her son in severe distress. Enter Dr. Darlene Stokes, an African American physician and single mother whose life is dedicated both to her own son and navigating the tricky maze of modern-day medicine. But something about Dori stirred the doctor''s suspicions. Darlene had heard of the sensational diagnosis of Munchausen by proxy, where a mother intentionally harms her baby, but she had never come upon a case of it before. It''s rarely diagnosed and extraordinarily controversial. Could it possibly have happened? <br>When these lives intersect with dramatic consequences, Darlene, Dori, and Josh are pushed to their breaking points as they confront the nightmare that has become their new reality. Darin Strauss''s extraordinary novel is set in a world turned upside down-where doctors try to save babies from their parents, police use the law to tear a family apart, and the people you know the best end up surprising you the most.<br>', null, 'Hardcover', '0525950702', '9780525950707', 416, '2008-06-19', 2008, 'Dutton Adult', 1269, 252), 
 (7875670, 3807842, 'Mr. Beluncle', 3.43, '“Like most great comedy,” writes Darin Strauss in his Introduction, “<em>Mr</em>. <em>Beluncle</em> makes sport of the Stuffed Shirt, the Hypocritical Pious Gentleman, and the Tyrant, as well as the Big Spender–and all these descriptions fit a single character: Mr. Beluncle himself.” One of V. S. Pritchett’s most enduring characters, Mr. Beluncle is narcissistic, sanctimonious, and self-indulgent, yet despite these flaws he is undeniably compelling. Readers who follow this quirky British furniture salesman on his seemingly ordinary escapades–shopping for ridiculously expensive houses, attending services at his peculiar church, presiding over a tumultuous family meal–are in for a delightful and disquieting ride. Poignant, hilarious, and utterly unforgettable <em>Mr. Beluncle</em> is an ideal introduction to one of the English language’s most gifted authors.<br><br><br><em>From the Trade Paperback edition.</em>', null, 'ebook', '0307538656', '9780307538659', 336, '2009-02-19', 2009, 'Modern Library', 14, 1), 
 (8114546, 3807842, 'Half a Life', 3.53, '"Half my life ago, I killed a girl.” <br>So begins Darin Strauss’ <em>Half a Life</em>, the true story of how one outing in his father’s Oldsmobile resulted in the death of a classmate and the beginning of a different, darker life for the author. We follow Strauss as he explores his startling past collision, funeral, the queasy drama of a high-stakes court case and what starts as a personal tale of a tragic event opens into the story of how to live with a very hard fact: we can try our human best in the crucial moment, and it might not be good enough. <br><em>Half a Life</em> is a nakedly honest, ultimately hopeful examination of guilt, responsibility, and living with the past.', null, 'Hardcover', '1934781703', '9781934781708', 205, '2010-09-15', 2010, 'McSweeney''s Publishing', 3384, 591), 
 (10312648, 3806785, 'The Arm Of The Stone (The Stone Duology, #1)', 3.73, '(from inside jacket) "In The Arm of the Stone, Victoria Strauss has created a reality of two worlds: Handpower, based on technology, and Mindpower, in which tools are regarded as dangerous heresy. A thousand years ago, when the worlds split apart, an ambitious sorcerer seized the Stone from which the powers of mind are drawn. To keep the new world from contamination, he established rigid rules circumscribing which machines may be built and what types of knowledge may be pursued-rules brutally enforced by an order of Guardians known as the Arm of the Stone. . . ."', null, null, '1604504943', '9781604504941', null, null, null, null, 149, 13), 
 (10373844, 3807842, 'Long Island Shaolin', 2.91, 'A recipient of the Guggenheim Fellowship and numerous other awards, internationally-bestselling writer Darin Strauss has been called “a brave new voice in literature,” by The Wall Street Journal, “one of the few great novelists of his generation,” by The Austin Chronicle, “as lyrical as he is daring,” by The New Yorker, “the bravest of writers,” by Salon, and “a master,” by The Chicago Tribune. His previous books are Chang &amp; Eng, The Real McCoy, and More Than It Hurts You.<br><br>His work has appeared in Esquire, The New York Times, The Washington Post, Newsweek and many other publications. His latest book, “Half a Life,” has been excerpted in GQ, This American Life, The Times of London and The Daily Mail (UK). He has appeared on Good Morning America, The Leonard Lopate Show, NBC News, Times-Talk, The Diane Rehm Show, CBS’s The Late Late Show with Craig Ferguson, and others. His books have been on various bestseller lists, named New York Times Notable Books, Los Angeles Times Best Books, Entertainment Weekly Must Books of the Year -- and Newsweek-, NPR- and Amazon Best Books of the Year. His work has been translated into fourteen languages and published in nineteen countries.', null, 'Kindle Edition', null, null, 16, '2011-01-12', 2011, null, 22, 3), 
 (10622819, 3806785, 'The Garden of the Stone (The Stone Duology, #2)', 3.77, '<p>At the heart of the fortress lay <em>the Garden.</em> At the heart of the Garden lay <em>the Stone.</em> -- a living entity of power beyond understanding. Then came Bron, his arrival long foretold as the one who would restore the balance to a world torn asunder centuries ago. But Bron had other plans. He stole the Stone...and vanished.</p><p>Now Bron''s daughter Cariad, a skilled empath and assassin, must follow the footsteps of a father she''s never known into the depths of the same fortress. Waiting there is Jolyon, her father''s greatest enemy, a man whose thirst for domination is matched only by his taste for blood. Cariad must learn the secret of Jolyon''s strength before it is too late. For just as her father''s arrival was prophesied, so too is his return.</p>', null, null, '160450496X', '9781604504965', null, null, null, null, 91, 6), 
 (14843862, 3806785, 'Passion Blue (Passion Blue, #1)', 3.68, '"Be sure you know your true heart’s desire, or you may find yourself surprised by what you receive."<br><br>This is the warning the Astrologer-Sorcerer gives Giulia when she pays him to create a magical talisman for her. The scorned illegitimate daughter of a Milanese nobleman, Giulia is determined to defy the dire fate predicted by her horoscope, and use the talisman to claim what she believes is her heart’s desire: true love and a place where she belongs–not likely prospects for a girl about to be packed off to the cloistered world of a convent.<br><br>But the convent of Santa Marta is full of surprises. There are strict rules, long hours of work, and spiteful rivalries…but there’s also friendship, and the biggest surprise of all: a workshop of female artists who produce paintings of astonishing beauty, using a luminous blue mixed from a secret formula: Passion blue. Yet even as Giulia begins to learn the mysteries of the painter’s craft, the magic of the talisman is at work, and a forbidden romance beckons her down a path of uncertainty and danger. She is haunted by the sorcerer’s warning, and by a question: does she really know the true compass of her heart?<br><br>Set in Renaissance Italy, this richly imagined novel about a girl’s daring journey towards self-discovery transports readers into a fascinating, exotic world where love, faith, and art inspire passion–of many different hues.(', null, 'Hardcover', '0761462309', '9780761462309', 352, '2012-11-06', 2012, 'Skyscape', 281, 75), 
 (21995033, 3806785, 'Color Song (Passion Blue, #2)', 3.87, 'By the author of the acclaimed "Passion Blue," a "Kirkus Reviews" Best Teen Book of 2012 and "a rare, rewarding, sumptuous exploration of artistic passion," comes a fascinating companion novel.<br><br>Artistically brilliant, Giulia is blessed - or cursed - with a spirit''s gift: she can hear the mysterious singing of the colors as she creates them in the convent workshop of Maestra Humilita. It''s here that Giulia, forced into the convent against her will, has found unexpected happiness and rekindled her passion to become a painter?an impossible dream for any woman in 15th century Italy.<br><br>But when a dying Humilita bequeaths Giulia her most prized possession - the secret formula for the luminously beautiful paint called Passion blue - Giulia realizes she''s in danger from those who have long coveted the famous color. Faced with the prospect of a life in the convent barred from painting as punishment for keeping Humilita''s secret, Giulia is struck by a desperate idea: What if she disguises herself as a boy? Could she make her way to Venice and find work as an artist''s apprentice?<br><br>Along with the truth of who she is, Giulia carries more dangerous secrets: the exquisite voices of her paint colors and the formula for Humilita''s Passion blue. And Venice, she discovers, with its gilded palazzos and masked balls, has secrets of its own. Trapped in her false identity in this dream-like place where reality and reflection are easily confused, and where art and ambition, love and deception hover like dense fog, can Giulia find her way?<br><br>This compelling novel explores timeless themes of love and illusion, gender and identity as it asks the question: what does it mean to risk everything to pursue your passion?', null, 'Paperback', '1477825045', '9781477825044', 344, '2014-09-16', 2014, 'Skyscape', 91, 29), 
 (25633451, 3826526, 'Anti Procrastination: 30+ Procrastination Buster Self Help Procrastination Cure Tips: Anti Procrastination Habits to Stop Being Lazy & Take Control of ... Procrastination Cure, Anti Procrastinate)', 0.0, null, null, null, null, null, null, null, null, null, 0, 0), 
 (25810549, 3807842, 'More Than It Hurts You', 0.0, '<strong>Read Darin Strauss''s posts on the Penguin Blog</strong><br><br>Josh Goldin''s happy yet unexamined existence is shattered one morning when his wife, Dori, rushes their eight-month- old son to the emergency room in severe distress. Dr. Darlene Stokes, an African-American physician and single mother, suspects Munchausen by proxy, a rarely diagnosed and controversial phenomenon where a mother intentionally harms her baby. As each of them is forced to confront a reality that has become a nightmare, Darlene, Dori, and Josh are pushed to their breaking points.<br><br> Darin Strauss''s extraordinary novel is set in a world turned upside down-where doctors try to save babies from their parents, police use the law to tear families apart, and the people you think you know best end up surprising you the most.', null, 'Audio', '1429537752', '9781429537759', null, '2008-06-19', 2008, 'Penguin Audio', 0, 0), 
 (25811448, 3806785, 'The Lady of Rhuddesmere', 0.0, null, null, null, null, null, null, null, null, null, 0, 0);
